import React from 'react'
import { Link } from 'react-router-dom'
import styled from 'styled-components'

const Sidebar = () => {

  const fetchPrivateData = async () => {
    console.log("GUACAMOLE")
    console.log(localStorage.getItem("access_token"))
    const config = {
      headers: {
        "Content-Type": "multipart/form-data",
        "Authorization": `Bearer ${localStorage.getItem("access_token")}`
      },
    };

    try {

      //AQUI VAN LAS RUTAS DE LAS GUIAS
      const { data } = await axios.post(`${process.env.REACT_APP_API_URL}/user/info`, {} ,config);
      console.log(data)

    } catch (error) {
      localStorage.removeItem("authToken");
      localStorage.removeItem("email");
      localStorage.removeItem("username");
      setError("You are not authorized please login");
    }

  };


  return (
    <SidebarWrapper>
      <LinksWrapper>
        <Link className="navbar-link" to="/">Dashboard</Link>
        <Link className="navbar-link" to="/">Generar Guia</Link>
        <Link className="navbar-link" to="/">Recargar</Link>
        <Link className="navbar-link" to="/">Cotizar</Link>
      </LinksWrapper>
    </SidebarWrapper>
  )
}

export default Sidebar;

const LinksWrapper = styled.div`
  display: flex;
  flex-direction: column;
  width: 80%;
  align-self: center;
  height: 60%;
  background-color: $quiken;
  justify-content: space-between;
  box-sizing: border-box;
  padding: 20px;
`

const SidebarWrapper =  styled.div`
  background-color: green;
  display: flex;
  flex-direction: column;
  width: 10%;
  height: 100%;
  font-size: 20px;
  justify-content: space-evenly;
`
